// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title HyperCoreEVMBridge
 * @notice Handles bidirectional asset transfers between HyperEVM and HyperCore
 * @dev Implements Hyperliquid's native bridge protocol for Aarna.ai vault
 */

interface IERC20 {
    function transfer(address to, uint256 amount) external returns (bool);
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
}

contract HyperCoreEVMBridge {

    // ============ State Variables ============

    /// @notice Native HYPE system address for Core transfers
    address public constant HYPE_SYSTEM_ADDRESS = 0x2222222222222222222222222222222222222222;

    /// @notice Authorized vault contract that can initiate transfers
    address public vaultContract;

    /// @notice Owner with admin privileges
    address public owner;

    /// @notice Emergency pause state
    bool public paused;

    /// @notice Mapping to track pending transfers (EVM -> Core)
    mapping(bytes32 => TransferInfo) public pendingTransfers;

    /// @notice Mapping to track completed Core -> EVM transfers
    mapping(bytes32 => bool) public completedTransfers;

    // ============ Structs ============

    struct TransferInfo {
        address token;
        uint256 amount;
        uint256 timestamp;
        address sender;
        bool completed;
    }

    // ============ Events ============

    event TransferToCore(
        bytes32 indexed transferId,
        address indexed token,
        uint256 indexed tokenIndex,
        uint256 amount,
        address sender
    );

    event TransferFromCore(
        bytes32 indexed transferId,
        uint256 indexed tokenIndex,
        uint256 amount,
        address recipient
    );

    event HYPETransferred(
        address indexed sender,
        uint256 amount,
        bytes32 transferId
    );

    event TransferCompleted(bytes32 indexed transferId);

    event VaultContractUpdated(address indexed oldVault, address indexed newVault);

    event Received(address indexed sender, uint256 amount);

    // ============ Modifiers ============

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    modifier onlyVault() {
        require(msg.sender == vaultContract, "Only vault");
        _;
    }

    modifier whenNotPaused() {
        require(!paused, "Contract paused");
        _;
    }

    // ============ Constructor ============

    constructor(address _vaultContract) {
        owner = msg.sender;
        vaultContract = _vaultContract;
        paused = false;
    }

    // ============ Core Transfer Functions ============

    /**
     * @notice Transfer ERC20 tokens from HyperEVM to HyperCore
     * @dev Sends tokens to system address 0x2000...tokenIndex
     * @param token Address of ERC20 token on HyperEVM
     * @param amount Amount to transfer (in token decimals)
     * @return transferId Unique identifier for tracking this transfer
     */
    function transferToCore(address token, uint256 amount) 
        external 
        onlyVault 
        whenNotPaused 
        returns (bytes32 transferId) 
    {
        require(token != address(0), "Invalid token");
        require(amount > 0, "Amount must be > 0");

        // Get token index from token address (implementation specific)
        uint256 tokenIndex = _getTokenIndex(token);

        // Calculate system address for this token
        address systemAddress = getSystemAddress(tokenIndex);

        // Generate unique transfer ID
        transferId = keccak256(abi.encodePacked(
            token,
            amount,
            block.timestamp,
            msg.sender
        ));

        // Transfer tokens from vault to system address
        bool success = IERC20(token).transferFrom(msg.sender, systemAddress, amount);
        require(success, "Transfer failed");

        // Record transfer info
        pendingTransfers[transferId] = TransferInfo({
            token: token,
            amount: amount,
            timestamp: block.timestamp,
            sender: msg.sender,
            completed: false
        });

        emit TransferToCore(transferId, token, tokenIndex, amount, msg.sender);

        return transferId;
    }

    /**
     * @notice Execute spotSend from HyperCore to HyperEVM
     * @dev Called after Core-side spotSend to system address
     * @param tokenIndex HIP-1 token index on HyperCore
     * @param amount Amount being transferred
     * @param recipient Address to receive tokens on HyperEVM
     * @return transferId Unique identifier for this transfer
     */
    function transferFromCore(
        uint256 tokenIndex, 
        uint256 amount, 
        address recipient
    ) 
        external 
        onlyVault 
        whenNotPaused 
        returns (bytes32 transferId) 
    {
        require(recipient != address(0), "Invalid recipient");
        require(amount > 0, "Amount must be > 0");

        // Generate transfer ID
        transferId = keccak256(abi.encodePacked(
            tokenIndex,
            amount,
            block.timestamp,
            recipient
        ));

        // Mark as completed (actual transfer happens via system tx)
        completedTransfers[transferId] = true;

        emit TransferFromCore(transferId, tokenIndex, amount, recipient);

        return transferId;
    }

    /**
 * @notice Calculate system address for given token index
 * @dev Format: 0x20 + zeros + tokenIndex in big-endian (last 8 bytes)
 * @param tokenIndex HIP-1 token index
 * @return systemAddress The computed system address
 */
function getSystemAddress(uint256 tokenIndex) 
    public 
    pure 
    returns (address systemAddress) 
{
    require(tokenIndex < type(uint64).max, "Token index too large");

    // Create address: 0x20 (1 byte) + zeros (11 bytes) + tokenIndex (8 bytes)
    // Total: 20 bytes = 160 bits for Ethereum address
    bytes memory addrBytes = new bytes(20);

    // First byte is 0x20
    addrBytes[0] = 0x20;

    // Bytes 1-11 are zeros (already initialized)

    // Last 8 bytes (indices 12-19) encode the token index in big-endian
    for (uint i = 0; i < 8; i++) {
        addrBytes[19 - i] = bytes1(uint8(tokenIndex >> (i * 8)));
    }

    systemAddress = address(uint160(bytes20(addrBytes)));

    return systemAddress;
}


    /**
     * @notice Transfer native HYPE token from HyperEVM to HyperCore
     * @dev Sends msg.value to 0x222...2 system address
     * @return transferId Unique identifier for tracking
     */
    function transferHYPEToCore() 
        external 
        payable 
        onlyVault 
        whenNotPaused 
        returns (bytes32 transferId) 
    {
        require(msg.value > 0, "Must send HYPE");

        // Generate transfer ID
        transferId = keccak256(abi.encodePacked(
            msg.sender,
            msg.value,
            block.timestamp
        ));

        // Transfer native HYPE to system address
        (bool success, ) = HYPE_SYSTEM_ADDRESS.call{value: msg.value}("");
        require(success, "HYPE transfer failed");

        emit HYPETransferred(msg.sender, msg.value, transferId);
        emit Received(msg.sender, msg.value);

        return transferId;
    }

    /**
     * @notice Check if Core -> EVM transfer has completed
     * @dev Verifies system transaction executed transfer() on token contract
     * @param transferId The transfer identifier to check
     * @return completed True if transfer is complete
     */
    function isTransferComplete(bytes32 transferId) 
        external 
        view 
        returns (bool completed) 
    {
        // Check if marked as completed in Core->EVM mapping
        if (completedTransfers[transferId]) {
            return true;
        }

        // Check if EVM->Core transfer is recorded and completed
        TransferInfo memory transfer = pendingTransfers[transferId];
        if (transfer.completed) {
            return true;
        }

        return false;
    }

    /**
     * @notice Estimate gas cost for transfers
     * @param isFromCore True if estimating Core->EVM, false for EVM->Core
     * @return gasCost Estimated gas units required
     */
    function getTransferGasCost(bool isFromCore) 
        external 
        pure 
        returns (uint256 gasCost) 
    {
        if (isFromCore) {
            // Core -> EVM costs 200k gas at base gas price
            return 200000;
        } else {
            // EVM -> Core costs standard ERC20 transfer (~50k)
            return 50000;
        }
    }

    // ============ Helper Functions ============

    /**
     * @notice Get token index from ERC20 address
     * @dev Placeholder - implement mapping based on your token list
     * @param token ERC20 token address
     * @return tokenIndex The HIP-1 index
     */
    function _getTokenIndex(address token) 
        internal 
        pure 
        returns (uint256 tokenIndex) 
    {
        // TODO: Implement proper token index mapping
        // This is placeholder logic - replace with actual index lookup
        // Example: USDT0 might be index 200, USDHL index 201, etc.

        // For now, derive from address (NOT production ready)
        tokenIndex = uint256(uint160(token)) % 1000;
        return tokenIndex;
    }

    /**
     * @notice Mark EVM->Core transfer as completed
     * @param transferId The transfer to mark complete
     */
    function completeTransfer(bytes32 transferId) 
        external 
        onlyVault 
    {
        require(pendingTransfers[transferId].amount > 0, "Transfer not found");
        pendingTransfers[transferId].completed = true;
        emit TransferCompleted(transferId);
    }

    // ============ Admin Functions ============

    /**
     * @notice Update vault contract address
     * @param newVault New authorized vault address
     */
    function setVaultContract(address newVault) 
        external 
        onlyOwner 
    {
        require(newVault != address(0), "Invalid vault");
        address oldVault = vaultContract;
        vaultContract = newVault;
        emit VaultContractUpdated(oldVault, newVault);
    }

    /**
     * @notice Emergency pause transfers
     */
    function pause() external onlyOwner {
        paused = true;
    }

    /**
     * @notice Resume transfers after pause
     */
    function unpause() external onlyOwner {
        paused = false;
    }

    /**
     * @notice Transfer ownership
     * @param newOwner New owner address
     */
    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "Invalid owner");
        owner = newOwner;
    }

    // ============ Fallback ============

    receive() external payable {
        emit Received(msg.sender, msg.value);
    }
}

contracts/hyperlend.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface IERC20 {
    function approve(address spender, uint256 amount) external returns (bool);
    function transfer(address to, uint256 amount) external returns (bool);
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

interface IHyperlendPool {
    function supply(address asset, uint256 amount, address onBehalfOf, uint16 referralCode) external;
    function withdraw(address asset, uint256 amount, address to) external returns (uint256);
    function borrow(address asset, uint256 amount, uint256 interestRateMode, uint16 referralCode, address onBehalfOf) external;
    function repay(address asset, uint256 amount, uint256 interestRateMode, address onBehalfOf) external returns (uint256);
    function getUserAccountData(address user) external view returns (
        uint256 totalCollateralBase,
        uint256 totalDebtBase,
        uint256 availableBorrowsBase,
        uint256 currentLiquidationThreshold,
        uint256 ltv,
        uint256 healthFactor
    );
}

// ✅ CORRECTED INTERFACE - Matches real Aave V3 / Hyperlend
interface IProtocolDataProvider {
    function getReserveData(address asset) external view returns (
        uint256 unbacked,
        uint256 accruedToTreasuryScaled,
        uint256 totalAToken,
        uint256 totalStableDebt,
        uint256 totalVariableDebt,
        uint256 liquidityRate,
        uint256 variableBorrowRate,
        uint256 stableBorrowRate,
        uint256 averageStableBorrowRate,
        uint256 liquidityIndex,
        uint256 variableBorrowIndex,
        uint40 lastUpdateTimestamp
    );

    function getReserveConfigurationData(address asset) external view returns (
        uint256 decimals,
        uint256 ltv,
        uint256 liquidationThreshold,
        uint256 liquidationBonus,
        uint256 reserveFactor,
        bool usageAsCollateralEnabled,
        bool borrowingEnabled,
        bool stableBorrowRateEnabled,
        bool isActive,
        bool isFrozen
    );
}

interface IHyperlendOracle {
    function getAssetPrice(address asset) external view returns (uint256);
}

/**
 * @title HyperlendAutoVault
 * @notice Auto-deposits to highest APY market on Hyperlend
 */
contract HyperlendAutoVault {

    address public owner;

    // ✅ REAL HYPERLEND CONTRACTS
    function HYPERLEND_POOL() public view virtual returns (address) {
        return 0x00A89d7a5A02160f20150EbEA7a2b5E4879A1A8b;
    }

    function PROTOCOL_DATA_PROVIDER() public view virtual returns (address) {
        return 0x5481bf8d3946E6A3168640c1D7523eB59F055a29;
    }

    function HYPERLEND_ORACLE() public view virtual returns (address) {
        return 0xC9Fb4fbE842d57EAc1dF3e641a281827493A630e;
    }

    // ✅ REAL ASSET ADDRESSES
    address public constant USDT0 = 0xB8CE59FC3717ada4C02eaDF9682A9e934F625ebb;
    address public constant WHYPE = 0x5555555555555555555555555555555555555555;
    address public constant wstHYPE = 0x94e8396e0869c9F2200760aF0621aFd240E1CF38;
    address public constant USDe = 0x5d3a1Ff2b6BAb83b63cd9AD0787074081a52ef34;
    address public constant sUSDe = 0x211Cc4DD073734dA055fbF44a2b4667d5E5fE5d2;
    address public constant USDHL = 0xb50A96253aBDF803D85efcDce07Ad8becBc52BD5;
    address public constant kHYPE = 0xfD739d4e423301CE9385c1fb8850539D657C296D;
    address public constant UBTC = 0x9FDBdA0A5e284c32744D2f17Ee5c74B284993463;
    address public constant UETH = 0xBe6727B535545C67d5cAa73dEa54865B92CF7907;    
    mapping(address => uint256) public userShares;
    mapping(address => address) public userActiveMarket;
    uint256 public totalShares;

    struct MarketData {
        address asset;
        uint256 supplyAPY;
        uint256 ltv;
        bool isActive;
    }

    event Deposited(address indexed user, address indexed asset, uint256 amount);
    event Withdrawn(address indexed user, address indexed asset, uint256 amount);
    event Borrowed(address indexed user, address indexed asset, uint256 amount);
    event Repaid(address indexed user, address indexed asset, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    /**
     * @notice Get supply APY for asset (CORRECTED)
     */
    function getSupplyAPY(address asset) public view returns (uint256) {
        try IProtocolDataProvider(PROTOCOL_DATA_PROVIDER()).getReserveData(asset) returns (
            uint256,  // unbacked
            uint256,  // accruedToTreasuryScaled
            uint256,  // totalAToken
            uint256,  // totalStableDebt
            uint256,  // totalVariableDebt
            uint256 liquidityRate,  // ← Supply rate
            uint256,  // variableBorrowRate
            uint256,  // stableBorrowRate
            uint256,  // averageStableBorrowRate
            uint256,  // liquidityIndex
            uint256,  // variableBorrowIndex
            uint40    // lastUpdateTimestamp
        ) {
            // Convert ray (1e27) to percentage with safety check
            if (liquidityRate == 0) return 0;

            // APY = liquidityRate * 100 / 1e27
            // Use unchecked for gas optimization since we know it won't overflow
            unchecked {
                return (liquidityRate * 100) / 1e27;
            }
        } catch {
            // If call fails, return 0 instead of reverting
            return 0;
        }
    }

    /**
     * @notice Get market data (CORRECTED)
     */
    function getMarketData(address asset) public view returns (MarketData memory) {
        try IProtocolDataProvider(PROTOCOL_DATA_PROVIDER()).getReserveConfigurationData(asset) returns (
            uint256,  // decimals
            uint256 ltv,
            uint256,  // liquidationThreshold
            uint256,  // liquidationBonus
            uint256,  // reserveFactor
            bool,     // usageAsCollateralEnabled
            bool,     // borrowingEnabled
            bool,     // stableBorrowRateEnabled
            bool isActive,
            bool      // isFrozen
        ) {
            return MarketData({
                asset: asset,
                supplyAPY: getSupplyAPY(asset),
                ltv: ltv,
                isActive: isActive
            });
        } catch {
            // Return empty data if call fails
            return MarketData({
                asset: asset,
                supplyAPY: 0,
                ltv: 0,
                isActive: false
            });
        }
    }

    /**
     * @notice Find highest APY market
     */
    function findBestMarket() public view returns (address bestAsset, uint256 highestAPY) {
        address[] memory assets = getSupportedAssets();
        highestAPY = 0;
        bestAsset = assets[0];

        for (uint256 i = 0; i < assets.length; i++) {
            uint256 apy = getSupplyAPY(assets[i]);
            if (apy > highestAPY) {
                highestAPY = apy;
                bestAsset = assets[i];
            }
        }

        return (bestAsset, highestAPY);
    }

    /**
     * @notice Deposit to vault
     */
    function deposit(address asset, uint256 amount) external {
        require(amount > 0, "Zero amount");

        IERC20(asset).transferFrom(msg.sender, address(this), amount);
        IERC20(asset).approve(HYPERLEND_POOL(), amount);

        IHyperlendPool(HYPERLEND_POOL()).supply(asset, amount, address(this), 0);

        userShares[msg.sender] += amount;
        totalShares += amount;
        userActiveMarket[msg.sender] = asset;

        emit Deposited(msg.sender, asset, amount);
    }

    /**
     * @notice Withdraw from vault
     */
    function withdraw(uint256 amount) external {
        address asset = userActiveMarket[msg.sender];
        require(userShares[msg.sender] >= amount, "Insufficient balance");

        uint256 withdrawn = IHyperlendPool(HYPERLEND_POOL()).withdraw(asset, amount, msg.sender);

        userShares[msg.sender] -= amount;
        totalShares -= amount;

        emit Withdrawn(msg.sender, asset, withdrawn);
    }

    /**
     * @notice Borrow against collateral
     */
    function borrow(address asset, uint256 amount) external {
        require(userShares[msg.sender] > 0, "No collateral");

        IHyperlendPool(HYPERLEND_POOL()).borrow(asset, amount, 2, 0, msg.sender);

        emit Borrowed(msg.sender, asset, amount);
    }

    /**
     * @notice Repay borrowed amount
     */
    function repay(address asset, uint256 amount) external {
        IERC20(asset).transferFrom(msg.sender, address(this), amount);
        IERC20(asset).approve(HYPERLEND_POOL(), amount);

        uint256 repaid = IHyperlendPool(HYPERLEND_POOL()).repay(asset, amount, 2, address(this));

        emit Repaid(msg.sender, asset, repaid);
    }

    /**
     * @notice Get supported assets
     */
    function getSupportedAssets() public pure returns (address[] memory) {
        address[] memory assets = new address[](9);
        assets[0] = USDT0;
        assets[1] = WHYPE;
        assets[2] = wstHYPE;
        assets[3] = USDe;
        assets[4] = sUSDe;
        assets[5] = USDHL;
        assets[6] = kHYPE;
        assets[7] = UBTC;
        assets[8] = UETH;
        return assets;
    }

    /**
     * @notice Display all markets
     */
    function displayMarkets() external view returns (
        address[] memory assets,
        uint256[] memory apys,
        uint256[] memory ltvs
    ) {
        address[] memory supportedAssets = getSupportedAssets();
        assets = new address[](supportedAssets.length);
        apys = new uint256[](supportedAssets.length);
        ltvs = new uint256[](supportedAssets.length);

        for (uint256 i = 0; i < supportedAssets.length; i++) {
            MarketData memory data = getMarketData(supportedAssets[i]);
            assets[i] = data.asset;
            apys[i] = data.supplyAPY;
            ltvs[i] = data.ltv;
        }

        return (assets, apys, ltvs);
    }
}

